import React, { useState } from "react";

const HotelF = () => {
  const [Fullname, setFullname] = useState();
  const [booking, setBooking] = useState([]);

  const [accept, setAccept] = useState(false);

  function inputEvents(event) {
    setFullname({
      ...state,
      [event.target.name]: event.target.value,
    });
  }
  const newBooking = { ...Fullname, id: new Date().getTime().toString() };

  function confirmBooking(event) {
    event.preventDefault();
    alert(`Welcome to ${Fullname.hotel}..
     Hotel Booked Successfully !!! `);
    setBooking([...booking, newBooking]);
    console.log(state);

    setState({
      name: "",
      email: "",
      mobile: "",
      location: "Shimala",
      hotel: "",
      checkIn: "",
      checkOut: "",
      termsConditions: "",
    });
  }
  console.log(booking);

  const InEvent = () => {};
  return (
    <>
      <h1>üè° Enjoy Your Stay at Manali üè°</h1>
      <form>
        <h2>Book Your Stay</h2>
        <label> Your Name : </label>
        <input
          type="text"
          placeholder="Enter your Name"
          name="Name"
          //   value={Fullname.Name}
          onChange={InEvent}
        />
        <br />
        <br />
        <label> Your Email Id : </label>
        <input
          type="email"
          placeholder="Enter your Email Id"
          name="Email"
          //   value={Fullname.Email}
          onChange={InEvent}
        />
        <br />
        <br />
        <label> Your Mobile No : </label>
        <input
          type="number"
          placeholder="Enter your Mobile No"
          name="Num"
          //   value={Fullname.Num}
          onChange={InEvent}
        />
        <br />
        <br />
        <label> Location : </label>
        <span>
          <input
            type="checkbox"
            name="location"
            defaultChecked={true}
            onChange={InEvent}
          />
        </span>
        <span> Manali,Himachal Pradesh</span>
        <br />
        <br />
        <label> Room Preference : </label>
        <select
          name="room"
          // value={Fullname.room}
          onChange={InEvent}
        >
          <option>Select Preference</option>
          <option>Standard</option>
          <option>Deluxe</option>
          <option>VIP</option>
        </select>
        <br />
        <br />
        <label> Hotel Name : </label>
        <select
          name="hotel"
          // value={Fullname.hotel}
          onChange={InEvent}
        >
          <option>Select Hotel</option>
          <option>The Oberoi Cecil </option>
          <option>Hotel Hayat</option>
          <option>J W Marriot</option>
          <option>Radisson Hotel Shimla</option>
          <option>Jomotel Talai </option>
          <option>Livingstone Ojuven Resort</option>
          <option>Treebo Trend Srishti Vaikunth</option>
        </select>
        <br />
        <br />
        <label>Marital Status : </label>
        <span>
          <input
            type="radio"
            name="marital"
            // value="Married"
            onClick={InEvent}
            // checked={Fullname.marital === "Married"}
          />
        </span>
        <span htmlFor="married">Married</span>
        <span>
          <input
            type="radio"
            name="marital"
            value="Unmarried"
            onChange={InEvent}
            // checked={Fullname.marital === "Unmarried"}
          />
        </span>
        <span htmlFor="unmarried">Unmarried</span>
        <br />
        <br />
        <label>Check-In : </label>
        <input
          type="date"
          className="dates"
          //   value={Fullname.checkIn}
          onChange={InEvent}
        />
        <br />
        <br />
        <label>Check-Out : </label>
        <input
          type="date"
          className="dates"
          //   value={Fullname.checkOut}
          onChange={InEvent}
        />
        <br />
        <br />
        <span>
          <input
            type="checkbox"
            name="termsConditions"
            checked={accept}
            onChange={(e) => setAccept(e.target.checked)}
          />
        </span>
        <span>Accept all the terms & conditions.</span>
        <br />
        <br />
        {accept ? (
          <button type="submit" onClick={confirmBooking}>
            BOOK NOW
          </button>
        ) : (
          <button type="submit" onClick={confirmBooking} disabled>
            BOOK NOW
          </button>
        )}
      </form>
    </>
  );
};

export default HotelF;
